import React from 'react';
class App extends React.Component {

    render() {
        return (
            <form >
                <h1>Uncontrolled Form Example</h1>
                <label>Name:
                    <input type="text" ref={this.input} />
                </label>
                <label>
                    CompanyName:
                    <input type="text" ref={this.input} />
                </label>
                <input type="submit" value="Submit" />
            </form>
        );
    }
}
export default App;
